  <input type="button" value= "Fotoboek" onClick = {this.props.setOnScreen.bind(this, ['fotoboek', 'chat'])} />
  <input type="button" value= "Bekijk de tuin" onClick = "window.open('https://www.youtube.com/watch?v=dQw4w9WgXcQ')" />
  </div>

  );
}
}
export default Menu;
